Dayna and Mick are colleagues at the same firm but Dayna out-performs everyone in the office. She is, therefore, offered a wonderful promotion to general director and will, one day soon, be running things. Problem is, she's got to get rid of Mick, the firm's weakest salesman. Can she do it and still be friends with the beleaguered staffer?
